import React from 'react';
import RestaurantCard from './RestaurantCard';

const RestaurantList = (props) => {
    const list = props.restaurants;
    return (
        <div>
            <ul>{list.map((item) => <RestaurantCard restaurant={item}/>)}</ul>
        </div>
    );
}

export default RestaurantList;
